import React from 'react';
import {Link} from 'react-router-dom';

function HomeButton(){
    return (
        <Link className="homeLink" to='/'>
            <img className="logoImage" alt="datastructs logo" src={require("../resources/project-diagram-solid.svg")}/>
            DataStrucs
        </Link>
    );
}

export default HomeButton;
